import React from "react";
import styled from "styled-components";

const DoneButton = styled.button`
  background-color: #5e6be5;
`;

const DoneFail = () => {
  return (
    <div>
      <DoneButton>&nbsp;</DoneButton>
    </div>
  );
};

export default DoneFail;
